@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("thepiratebay.org") {

  .ad,
  .ads,
  .spons-link,
  a.noborder,
  iFrame,
  #tp_frame1,
  #sky-banner,
  #adbrite-banner { display: none !important; }

  #q,
  .download,
  #details h4,
  #detailsframe #title { text-align: center !important; 
                         height: auto !important}

  .H2, H2 SPAN {
    text-align: center !important;
    float: none !important
  }

  #main-content, #detailsouterframe, 
  #comments .comment, #details p, .nfo {
    width: auto !important;
    margin-left: 5pt !important;
    margin-right: 5pt !important;
  }

  #categoriesTable {
    width: 90% !important;
  }
  #browseContainer, #browseContainer DT, 
  #browseContainer DD  {
    text-align: center !important;
    float: none !important;
    padding: 5pt !important;
  }

  
body {
	background: #253960 url("data:image/png;base64,") top left repeat-x !important;
	color: #FFF !important;
}

a:link { color: #82BDFF !important; border-bottom: 1px dotted #82BDFF !important;}
a:hover {border-bottom: 1px solid #82BDFF !important;}
a:visited { color: #72ADDF !important; border-bottom: 1px dotted #82BDFF !important; }
a:visited:hover { border-bottom: 1px solid #82BDFF !important; }
a:active { color: #92CDFF !important; }

h2 { background: #405882 url("data:image/gif;base64,R0lGODlhAQAKAJEAAFBmjVRqkGd9oQAAACH5BAAAAAAALAAAAAABAAoAAAIEhIAJUQA7") top left repeat-x !important;
     border: none !important;}

h4 {color: #82bdff !important;}

table#searchResult a { color: #000 !important; border: none !important; }
table#searchResult a:hover { text-decoration: underline; }
div#SearchResults > div#content > div > a {border: none !important;}
thead#tableHead a { color: #000 !important; }
thead#tableHead a:hover { color: #000 !important; }
thead#tableHead th { background: #d5dae0 !important; color: #000 !important;}
table#searchResult th { border: 1px solid #000 !important;  padding-left: 5px !important;}
table#searchResult td { border: 1px solid #d5dae0 !important; padding-left: 5px !important;}
table#searchResult tr { background: #fff !important; color: #000 !important;}
table#searchResult tr.alt { background: #f0f1f2 !important; }
table#searchResult tr:hover { background: #d5dae0 !important; }

